import React, { Component } from "react";
import Iframe from "react-iframe";

export default class Archrenderings extends Component {
  render() {
    return (
      <div>
        <iframe
          src="https://player.vimeo.com/video/364928434"
          width="640"
          height="360"
          frameborder="0"
          allow="autoplay; fullscreen"
          allowfullscreen
        ></iframe>
        <p>
          <a href="https://vimeo.com/364928434">arch2</a> from{" "}
          <a href="https://vimeo.com/user72134418">Carl-Gustaf Ewerbring</a> on{" "}
          <a href="https://vimeo.com">Vimeo</a>.
        </p>
        <h1>park</h1>
      </div>
    );
  }
}
